INSERT INTO `jos_content` VALUES(1, 'C Bienvenue sur 7LTV Montpellier', 'Bienvenue', '<p>Si vous avez tout lu sur 7LTV Montpellier, vous aurez probablement retenu que c&#39;est un gros bordel et qu&#39;on se demande qui fait quoi dans cette cha&icirc;ne.</p><p>      &nbsp;</p><p>{mosimage}Joomla! est en train de changer la donne... Joomla! est diff&eacute;rent du mod&egrave;le habituel de logiciel web. Pour commencer, Joomla! est simple &agrave; prendre en main. Joomla! a &eacute;t&eacute; d&eacute;velopp&eacute; pour le plus grand nombre.</p><p>&nbsp;</p><p>&nbsp;</p>', '<h4><font color="#ff6600">Fonctionnalit&eacute; Joomla!:</font></h4><ul><li>Site enti&egrave;rement pilot&eacute; par une base de donn&eacute;es</li><li>Articles &eacute;ditables et g&eacute;rables sans limitations</li><li>Les contributeurs peuvent soumettre des articles</li><li>Design enti&egrave;rement personnalisable</li><li>Gestionnaire d&#39;images</li><li>Gestionnaire de sondages/banni&egrave;res/votes</li><li>Fonctionne sous Linux, FreeBSD, MacOSX, Solaris et AIX</li></ul><h4>Administration &eacute;tendue:</h4><ul><li>Changement de l&#39;ordre d&#39;affichage des articles</li><li>G&eacute;n&eacute;rateur de Newsflash al&eacute;atoires</li><li>Soumission d&#39;articles depuis l&#39;interface publique</li><li>Hi&eacute;rarchie des articles en sections et cat&eacute;gories</li><li>Librairie d&#39;images - stockage de fichiers PNGs, PDFs, DOCs, XLSs, GIFs et JPEGs</li><li>Gestionnaire de flux RSS</li><li>Archivage des articles</li><li>Envoi d&#39;article par mail ou en format imprimable</li><li>Editeur WYSIWYG</li><li>Installation en 2 clics des templates et des extensions</li></ul>', 1, 1, 0, 1, '2004-06-12 11:54:06', 62, 'Webmaster', '2008-03-13 17:34:52', 62, 0, '0000-00-00 00:00:00', '2004-01-01 00:00:00', '0000-00-00 00:00:00', 'asterisk.png|left|Joomla! Logo|1|Exemple Caption|bottom|center|120', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=0\nauthor=0\ncreatedate=0\nmodifydate=0\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 36, 0, 1, '', '', 0, 3);
INSERT INTO `jos_content` VALUES(2, 'H Newsflash 1', '', '<p>7LTV en TNT, tournez votre antenne vers St Baudille</p>\r\n\r\n<p>&nbsp;\r\n{flvremote}http://7ltv.free.fr/Comext/CINX2011B.flv{/flvremote}\r\n\r\n', '', 1, 2, 0, 3, '2004-08-09 08:30:34', 62, '', '2008-05-06 12:27:21', 62, 0, '0000-00-00 00:00:00', '2004-08-09 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 7, 0, 2, '', '', 0, 10);
INSERT INTO `jos_content` VALUES(3, 'I Newsflash 2', '', 'Une t&eacute;l&eacute;vision locale &agrave; Montpellier, 7LTV Montpellier est sur la place de la com&eacute;die pour enregistrer vos messages de St Valentin.', '', 1, 2, 0, 3, '2004-08-09 08:30:34', 62, '', '2008-05-06 12:05:55', 62, 0, '0000-00-00 00:00:00', '2004-08-09 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 4, 0, 3, '', '', 0, 10);
INSERT INTO `jos_content` VALUES(4, 'Bienvenue ! ', '', '<td width="10">&nbsp;</td>&nbsp;<td width="472" height="316" align="left" valign="top">&nbsp;</td> <p class="Style1">7L tv Montpellier, la cha&icirc;ne qui compte &agrave; Montpellier !<br />7L tv Montpellier est la cha&icirc;ne de t&eacute;l&eacute;vision locale de Montpellier et sa r&eacute;gion.<br />7L tv propose ses programmes 7 jours sur 7 et 24h sur 24h.<br />7L tv est diffus&eacute;e gratuitement sur la TNT (cha&icirc;ne 21) des Saintes Maries de la Mer <br />aux portes de Narbonne.<br />7L tv b&eacute;n&eacute;ficie donc de pr&egrave;s de 1 million de t&eacute;l&eacute;spectateurs potentiels !</p><p class="Style1">Chaque soir, les &eacute;quipes de 7L tv proposent aux montpelli&eacute;rains et plus largement aux h&eacute;raultais de d&eacute;couvrir leur actualit&eacute; d&rsquo;un &oelig;il diff&eacute;rent !</p>', '', 1, 2, 0, 3, '2004-08-09 08:30:34', 62, '', '2008-09-10 10:03:26', 62, 0, '0000-00-00 00:00:00', '2004-08-09 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 3, 0, 5, '', '', 0, 11);
INSERT INTO `jos_content` VALUES(5, 'Joomla! License Guidelines', '', '<p>This website is powered by <a href="http://www.joomla.org/">Joomla!</a>  The software and default templates on which it runs are Copyright 2005 <a href="http://www.opensourcematters.org/">Open Source Matters</a>.  All other content and data, including data entered into this website and templates added after installation, are copyrighted by their respective copyright owners.</p><p>If you want to distribute, copy or modify Joomla!, you are welcome to do so under the terms of the <a href="http://www.gnu.org/copyleft/gpl.html#SEC1">GNU General Public License</a>.  If you are unfamiliar with this license, you might want to read <a href="http://www.gnu.org/copyleft/gpl.html#SEC4">&#39;How To Apply These Terms To Your Program&#39;</a> and the <a href="http://www.gnu.org/licenses/gpl-faq.html">&#39;GNU General Public License FAQ&#39;</a>.</p>  ', '', 1, 0, 0, 0, '2004-08-19 20:11:07', 62, '', '2008-01-28 18:30:51', 62, 0, '0000-00-00 00:00:00', '2004-08-19 00:00:00', '0000-00-00 00:00:00', '', '', 'menu_image=-1\nitem_title=1\npageclass_sfx=\nback_button=\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=', 1, 0, 11, '', '', 0, 12);
INSERT INTO `jos_content` VALUES(6, '7LTV enfin sur le Web', 'News1', '<p align="justify">{mosimage} 7LTV Montpellier est votre cha&icirc;ne de t&eacute;l&eacute;vision locale. Actualit&eacute;s, Sports, Magazines, M&eacute;t&eacute;o, Economie, Divertissements, tout ce qui fait votre Quotidien est sur 7LTV.</p><p align="justify">D&egrave;s 18h, retrouvez en Direct les nouvelles th&eacute;matiques de 7LTV pour un tour de l&#39;actualit&eacute; Montpelli&eacute;raine.</p><p align="justify">A 19h, le Journal Tout Images </p><p align="justify">A 19h15, la page magazine avec des programmes qui d&eacute;cortiquent les moments fort des derniers &eacute;v&egrave;nements sportifs, l&#39;actualit&eacute; &eacute;conomique du Languedoc, l&#39;automobile. </p>', '', 1, 2, 0, 3, '2004-07-07 11:54:06', 62, '', '2008-09-10 10:02:04', 62, 0, '0000-00-00 00:00:00', '2004-07-07 00:00:00', '0000-00-00 00:00:00', 'tele.jpg|right||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 17, 0, 4, '', '', 0, 25);
INSERT INTO `jos_content` VALUES(13, 'La Chaîne', '', '<div id="main"><div id="content"><div class="post"><div class="post-content"><table border="0" width="845" height="926" align="center"><tbody><tr><td align="left" valign="top"><p class="Style1">7L tv, c&#39;est une &eacute;quipe de 26 personnes dont 13 journalistes, 6 techniciens polyvalents, 1 r&eacute;alisateur et 3 commerciaux.<br /><br />7L tv, la cha&icirc;ne de la convivialit&eacute; et de la proximit&eacute;</p><p class="Style1">7L tv donne la parole &agrave; tous les acteurs de l&rsquo;actualit&eacute; montpelli&eacute;raine et de sa r&eacute;gion.</p><p class="Style1">1400 personnes nous ont d&eacute;j&agrave; fait l&rsquo;honneur de r&eacute;pondre aux invitations de 7L tv.</p><p class="Style1">Cha&icirc;ne d&rsquo;information g&eacute;n&eacute;raliste, s&rsquo;adressant aux 15-49 ans, 7L tv d&eacute;veloppe progressivement sa grille de programmes en renfor&ccedil;ant sa pr&eacute;sence sur le terrain et en proposant , d&eacute;s la rentr&eacute;e prochaine de nouveaux programmes.</p></td><td align="left" valign="top"><div align="center"><img style="width: 315px; height: 243px" src="http://s147425689.onlinehome.fr/dotclear/themes/default/img/photos/terrain.jpg" alt="" width="315" height="243" /></div></td></tr><tr><td height="36">&nbsp;</td><td>&nbsp;</td></tr><tr><td class="Style1" height="252" valign="top"><p><strong>18H &ndash; 20H : des directs chaque jour !</strong></p><p>Devenue incontournable dans le paysage audiovisuel local, 7L tv propose, chaque jour, 2 heures d&rsquo;&eacute;missions en direct entre 18h et 20h. Enti&egrave;rement orient&eacute;es vers l&rsquo;actualit&eacute; locale, les &eacute;missions de 7L tv offre un regard diff&eacute;rent sur Montpellier et sa r&eacute;gion (Journal tout en images, talk-show, magazines &eacute;conomiques, &eacute;tudiants, sportifs &hellip;)</p><p>7L tv, c&rsquo;est 2 h de programmes quotidiens &agrave; d&eacute;couvrir chaque soir entre 18h et 20h, ou au gr&eacute;s de vos envies au fil des rediffusions de la semaine.</p></td><td valign="middle"><div align="center"><p><img style="width: 315px; height: 225px" src="http://s147425689.onlinehome.fr/dotclear/themes/default/img/photos/regie.jpg" alt="" width="315" height="225" /></p><p>&nbsp;</p></div></td></tr><tr><td class="Style1" valign="top"><p><strong>7L tv, la plus High tech des cha&icirc;nes de t&eacute;l&eacute;vision locale !</strong></p><p>7L tv est la premi&egrave;re cha&icirc;ne enti&egrave;rement num&eacute;rique du paysage audiovisuel.</p><p>Equip&eacute;es de 8 unit&eacute;s de tournage &agrave; disques durs, de 8 bancs de montage num&eacute;riques, 7L tv a d&eacute;lib&eacute;r&eacute;ment choisi d&rsquo;&eacute;liminer les supports magn&eacute;tiques de sa cha&icirc;ne de fabrication afin de limiter l&rsquo;impact de la cha&icirc;ne sur l&rsquo;environnement.</p><p>Avec son plateau de 180 m2, 7L tv dispose de la plus grande surface de production t&eacute;l&eacute;visuelle disponible en Languedoc-Roussillon.</p></td><td><div align="center"><img style="width: 315px; height: 225px" src="http://s147425689.onlinehome.fr/dotclear/themes/default/img/photos/plateau.jpg" alt="" width="315" height="225" /></div></td></tr></tbody></table></div></div></div></div>', '', 1, 5, 0, 13, '2008-09-10 10:04:07', 62, '', '2008-09-10 10:20:12', 62, 0, '0000-00-00 00:00:00', '2008-09-10 10:03:39', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 3, 0, 1, '', '', 0, 2);
